measurements.description:
Seven delightfully fragrant flowers on one upright 51-cm inflorescence;
 sepals and petals lanceolate, acute, yellow blushed maroon, veined maroon, spotted maroon proximally;

 lip rectangular, obtuse, recurved distally, margins undualte, yellow, lightly blushed maroon, blotched maroon,
 two prominent keels;
 column yellow, spotted maroon, anther cap yellow;
 substance firm; texture satiny, lip velvety.
